    return (
      <Container>
        <div>
          <h2>{this.state.name}さんようこそ！</h2>
          <div>
          <Link to="/videoUpload">動画をアップロード</Link>
          </div>
          <div>
            <Link to="/logout">ログアウト</Link>
          {console.log(typeof(this.state.video))}
          {this.state.video.map((d, i) => <li key={i}>{d.title}</li>)}
